import React, { Component } from "react";
import Pnav from "../Projects";

export default class Cosmos extends Component {
  render() {
    return (
      <div>
        <Pnav>/></Pnav>
        <img
          className="Cosmosbild"
          src={require("./Cosmos/giffilelarge.gif")}
        />
      </div>
    );
  }
}
